val trainingSummary = rModel.summary

// Obtain the objective per iteration.
val objectiveHistory = trainingSummary.objectiveHistory
objectiveHistory.foreach(loss => println(loss))

// Obtain the metrics useful to judge performance on test data.
// We cast the summary to a BinaryLogisticRegressionSummary since the problem is a
// binary classification problem.
val binarySummary = trainingSummary.asInstanceOf[BinaryLogisticRegressionSummary]

// Obtain the receiver-operating characteristic as a dataframe and areaUnderROC.
val roc = binarySummary.roc
roc.show()

roc.createOrReplaceTempView("roc")

println(binarySummary.areaUnderROC)

// Set the model threshold to maximize F-Measure
val fMeasure = binarySummary.fMeasureByThreshold
fMeasure.show
val maxFMeasure = fMeasure.select(max("F-Measure")).head().getDouble(0)
val bestThreshold = fMeasure.where($"F-Measure" === maxFMeasure).select("threshold").head().getDouble(0)
rModel.setThreshold(bestThreshold)
fMeasure.createOrReplaceTempView("fMeasure")

// transform test data
val prediction = rModel.transform(test)

// generate preditions
prediction.select("label", "prediction","features", "probability").show(3)    
prediction.select("label", "prediction","features", "probability", "rawPrediction").collect.foreach(println)
